import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <nav className="flex items-center justify-between flex-wrap bg-red-500 p-6 z-40 relative">
      <div className="w-9/12 inline-flex">
        <div className="flex items-center flex-shrink-0 text-white mr-6">
          <span className="font-semibold text-xl tracking-tight">ABL</span>
        </div>
        <div className={`w-full block flex-grow lg:flex lg:items-center lg:w-auto`}>
          <span className="text-white font-bold mt-1">
            &copy; 2020{' '}
            <Link className="text-gray-400 hover:text-gray-500" to="addison.codes">
              addison.codes
            </Link>
          </span>
        </div>
      </div>
    </nav>
  );
};

export default Footer;
